import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function App(){
    return(
    <div>
        <h1>Kalkulator średniego spalania na 100 km</h1>
        <div>Spalone paliwo w litrach: <input type="number" name="fuel"/></div>
        <div>Ilość przejechanych kilometrów: <input type="number" name="km"/></div>
        <div>Cena litra paliwa (opcjonalne) <input type="number" name="cost"/></div>
        <button>Oblicz</button>
    </div>
    );


}


ReactDOM.render(<App />, document.getElementById('root'));
